script: |
  super -f text -I q5082.spq | sort > q5082.out

inputs:
  - name: q5082.spq
    data: |
      SELECT DISTINCT + col0 AS col1 FROM tab1 (FORMAT parquet) WHERE NOT - col1 / + 29 - - + col0 + - 95 * + col0 * + - 99 IS NULL;
  - name: tab1

outputs:
  - name: q5082.out
    data: |
      51
      85
      91
